import Link from "next/link";

const About = () => (
  <div>
    <h1>About BitPrice</h1>
    <li>
      <Link href="/">
        <a>Home</a>
      </Link>
    </li>

    <p>Application to view Bitcoin prices</p>
  </div>
);
export default About;
